import React from 'react';

export default function Element (params) {
    return <div id={params.id} key={params.id}>
        <img 
        className='poster' 
        src={params.image} 
        alt={`Element-Movie: ${params.name}`} 
        />
        <h2 className="text-center font-bold font-">{params.name}</h2>
    </div>
}
